import React, { Component } from 'react';


const Index = () =>{
    return (
        <div>
            <h1>Home</h1>
            <a href='/api/login' 
                className='py-4 
                    px-2 
                    rounded 
                    bg-pink-800 
                    font-bold 
                    shadow
                    w-1/4
                    text-cente
                    mx-auto
                    text-white'>Comece por aqui</a> 
        </div>
    ) 
}

export default Index;
